import React from 'react';

const Button = () => {
    return (
        <div
            className="ml-[30px] mt-[15px] w-24 h-6 text-center text-black text-sm font-bold font-['Roboto'] leading-[15px] tracking-tight">Добавить
            виджет
        </div>
    );
};

export default Button;
